import Image from "../../../../image/white_checker.png";

const rows = 7;

function WhiteChecker(props) {
    return (
        <div style={{ gridColumn: props.y, gridRow: props.x }}>
            {Array.from({ length: rows - props.y }, (_, i) => (
                <img key={i} src={Image} alt="" />
            ))}
        </div>
    );
}

export default WhiteChecker;
